import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { fetchData, fetchDetails } from "../../../utils/utils";
import { setMovieGenres } from "../../../slices/MovieSlice";

const Category = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    async function fetchDataFunction() {
      const result = await fetchData(`genre/movie/list?language=en`);
      dispatch(setMovieGenres(result));
    }

    fetchDataFunction();
  }, [dispatch]);

  //   const movieGenresList = useSelector((state) => state.movie.movieGenres.data);

  return <div>Category</div>;
};

export default Category;
